        "created": 1404749084000, 
        "description": "<p>DC Legal Hackers is the DC Chapter of a growing movement of<a href=\"https://legalinformatics.wordpress.com/2013/09/12/legal-hacking-technology-and-innovation-groups/\">\u00a0more than twenty</a>\u00a0legal hacking, technology, or innovation groups around the country.\u00a0</p> <p>A legal hacker is someone who cares about the intersection of law and technology and seeks to improve legal practice through technology while simultaneously using legal skills to promote technological innovation and exploration.\u00a0</p> <p>Join us in December for our Legal Hackie Awards and Holiday Party</p> <p>7-7:30 Food, drinks and networking holiday party addition</p> <p>7:30-8:00 Award announcements and featured project recognition\u00a0</p> <p>8:00 - 9:00 Food, drinks and networking holiday party addition</p> <p>Follow along on twitter with the hashtag #LegalHack or at www.twitter.com/DCLegalHackers</p>", 
