        "created": 1408548417000, 
        "description": "<p>For September, we'll be discussing three tech projects and their impact on local transportation issues.</p> <p>\u2022\u00a0Nick Ramfos of <a href=\"http://www.mwcog.org/\">MWCOG</a> will show us their new <a href=\"http://www.commuterconnections.org/\">Commuter Connections</a> app which helps you find carpool partners, locate park-and-ride lots, and access other tools to find easier, less expensive ways to get to work.</p> <p>\u2022\u00a0Stephanie Nguyen of <a href=\"http://silicalabs.com/\">Silica Labs</a> will preview their upcoming \"Landmark\" app, which helps people navigate streets using landmarks rather than traditional maps.</p> <p><br/>\u2022\u00a0Lou Huang will show us <a href=\"http://streetmix.net/\">streetmix</a>, a project he worked on as a <a href=\"http://www.codeforamerica.org/\">Code for America</a> fellow, and introduce us to a related Code for America project, <a href=\"http://www.transitmix.net/\">transitmix</a>.</p>", 
